import React, { Component } from "react";
import "./estilos.css";
import 'bootstrap/dist/css/bootstrap.min.css';

class NumeroDeCartas extends Component{
    constructor(props){
        super(props)
    }

   render(){
       return(
           <section>
               
                    <label>5</label>
                   <input name='num' type='radio' value='5'/>
                   <label>10</label>
                   <input name='num' type='radio' value='10'/>
                   <label>15</label>
                   <input name='num' type='radio' value='15'/>
                   <label>20</label>
                   <input name='num' type='radio' value='20'/>
                    <label htmlFor='quaisCartas'>Escolher:</label>
                   <select id='quaisCartas'>
                        <option value="aleatoria">Aleatoriamente</option>
                       <option value='melhores'>Melhores cartas</option>
                       <option value='piores'>Piores cartas</option>
                   </select>
                                  
           </section>

       )
   }
}

export default NumeroDeCartas;
